import logo from './logo.svg';
import './App.css';
import React, {useContext, useEffect, useReducer} from 'react';
import {login, session, SessionContext} from "./Contexts/SessionContext";

const initState = {
    waiting: false,
    loggedIn: false
}
const sessionReducer = (state = initState, action) => {
    switch (action.type) {
        case 'attempt_login':
            return {
                ...state,
                waiting: true,
                loggedIn: false
            }
        case 'login_success':
            return {
                ...state,
                waiting: true,
                loggedIn: false
            }
        case 'login_fail':
            return {
                ...state,
                waiting: true,
                loggedIn: false
            }
        case 'attempt_logout':
            return {
                ...state,
                waiting: true,
                loggedIn: false
            }
        case 'logout_success':
            return {
                ...state,
                waiting: true,
                loggedIn: false
            }
    }
}

function App() {
    const [state, dispatch] = useReducer(sessionReducer, {waiting: false, loggedIn: false});

    console.log(state);

    dispatch({type: 'attempt_login'})

  return (
    <div className="App">

    </div>
  );
}

export default App;
